import React from 'react';
import Header from '../components/Header';
import WalletForm from '../components/WalletForm';

class Wallet extends React.Component {
  constructor() {
    super();

    this.state = {
      coinsObj: {},
    };
  }

  componentDidMount() {
    const coins = getEconomia();
    coins.then((response) => {
      delete response.USDT;
      const coinsWithoutUSDT = response;
      this.setState({ coinsObj: coinsWithoutUSDT }, () => {
        this.updateState();
      });
    });
  }

  updateState = () => {
    const { coinsObj } = this.state;
    console.log(Object.keys(coinsObj));
    const { dispatch } = this.props;
    dispatch(addCoins(Object.keys(coinsObj)));
  };

  render() {
    return (
      <div>
        <Header />
        <WalletForm />
      </div>
    );
  }
}

export default Wallet;
